import React from 'react'
import { Form, Input } from 'antd'

class AnimalServeyComponent extends React.Component {

    render() {
        return (
            <div>
                <Form>
                    <Form.Item>
                        <Input />
                    </Form.Item>
                </Form>
            </div>
        )
    }
}

export default AnimalServeyComponent
